// EquipmentList.js
import React from "react";
import ExpandableSection from "./ExpandableSection";

export const EquipmentList = ({ id, equipments }) => {
  return (
    <div className="List-Destop">
      {/* Passer l'ID en prop à ExpandableSection */}
      <ExpandableSection id={id} title="Équipements">
        <div>
          <div>
            {equipments.map((equipment, index) => (
              <p key={index}>{equipment}</p>
            ))}
          </div>
        </div>
      </ExpandableSection>
    </div>
  );
};
